import React from 'react'
import BasePageWithCard from '../BasePages/BasePageWithCard';
import CreateScheduleProtectionForm from '../../components/Forms/CreateScheduleProtectionForm/CreateScheduleProtectionForm';

function CreateSheduleProtection({secretaryData, groups_for_schedule, students_list_for_schedule}) {
  return (
    <BasePageWithCard isAuthenticated={true} data={secretaryData}>
<CreateScheduleProtectionForm  groups_for_schedule={groups_for_schedule} students_list_for_schedule={students_list_for_schedule}/>
          </BasePageWithCard>
  )
}

export default CreateSheduleProtection
